import React from "react";

const MachineTable = ({ list }) => {
  return (
    <table>
      <thead>
        <tr> 
          <th>Name</th>
		</tr>
      </thead>
      <tbody>
        {  list.map( (list, index) => {
           return (
            <tr key={ index }>
              <td>{ list.name }</td>
			</tr>
          );
         })
		}
      </tbody>
    </table>
  );
}

export default MachineTable;
